import React from 'react';
const Api = ({consumir, perfiles, onChange, form}) =>(
    <div className="container">
        <div className="text-center mt-5">
            <button onClick={consumir} className="btn btn-success">Consumir</button>
        </div>
        <div className="mt-3">
            {
                perfiles.map(
                    (item, i) => (
                        <div class="card">
                            <div class="card-body">
                                <img src={item.avatar_url} alt="Perfil" width="80" height="80" class="rounded"/>
                                <a target="_blank" rel="noreferrer" href={item.html_url} key={i}>{item.login}</a>
                            </div>
                        </div>
                    )
                )
            }
        </div>
    </div>
);

export default Api;
